import React from 'react'
import Login from '../buttons/Login'
import Signup from '../buttons/Signup'

const CheckoutSignin = () => {
  return (
    <>
      <h1 className="h3 mb-3 fw-normal text-center">Por favor ingresa tu usuario</h1>
      <div className="container text-center">
        <div className="form-floating py-2">
          <Login w={50} />
        </div>
        <div className="form-floating py-3">
          <Signup w={50} />
        </div>
        <div className="form-floating py-2"></div>
        <button className="w-50 btn btn-light" type="submit">Continua como visitante</button>
        <p className="mt-5 mb-3 text-muted">© 2017–2022</p>
      </div>

    </>
  )
}
//  <div className='container py-2 mx-auto '>
//       <div className='py-3 mx-auto' >
//         <Login w={100} />
//       </div>
//       <div className='py-3 mx-auto'>
//         <Signup w={100}/>
//       </div>
//     </div> 
export default CheckoutSignin
